if (chart.at12hs.candle.close < (tradingEngine.tradingCurrent.position.entryTargetRate.value * (1 - (profitTarget2 / 100))) && tradingEngine.tradingCurrent.position.stopLoss.value > (chart.at12hs.candle.close * (1 + (trailingStopLoss2 / 100)))) {
