}

else if (chart.at12hs.candle.close < (tradingEngine.tradingCurrent.position.entryTargetRate.value * (1 - (profitTarget1 / 100))) && tradingEngine.tradingCurrent.position.stopLoss.value > chart.at12hs.candle.close + ((chart.at12hs.candle.close - tradingEngine.tradingCurrent.position.entryTargetRate.value) / profitDivider)) {
    chart.at12hs.candle.close + ((chart.at12hs.candle.close + tradingEngine.tradingCurrent.position.entryTargetRate.value) / profitDivider)
